import './App.css';

import {Home} from './Home';
import {Restoranti} from './Restoranti';
import {Navigation} from './Navigation';
import {Qyteti} from './Qyteti';

import {BrowserRouter, Route, Switch,NavLink} from 'react-router-dom';
import {Navbar,Nav} from 'react-bootstrap';

function App() {
  return (
    <BrowserRouter>
    <div className="App container">
      <h3 className="d-flex justify-content-center m-3">
        React JS Frontend
      </h3>

      <Navbar bg="dark" expand="lg">
                <Navbar.Toggle aria-controls="basic-navbar-nav"/>
                <Navbar.Collapse id="basic-navbar-nav">
                <Nav>NavLink
                <Navlink className="d-inline p-2 bg-dark text-white" to="/">
                    Home
                </Navlink>
                <Navlink to="/restoranti" className="d-inline p-2 bg-dark text-white">
                    Restorantet
                </Navlink>
                <Navlink to="/qyteti" className="d-inline p-2 bg-dark text-white">
                    Qytetet
                </Navlink>

                </Nav>
                </Navbar.Collapse>
            </Navbar>

      <Switch>
        <Route path='/home' component={Home}/>
        <Route path='/department' component={Restoranti}/>
        <Route path='/employee' component={Qyteti}/>
      </Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
